document.addEventListener("DOMContentLoaded", () => {
	const serviceBtn = document.getElementById("service-btn");
	const courseBtn = document.getElementById("course-btn");
	const serviceGrid = document.getElementById("service-grid");
	const courseGrid = document.getElementById("course-grid");

	serviceBtn.addEventListener("click", () => {
		serviceGrid.classList.remove("hidden");
		courseGrid.classList.add("hidden");
		serviceBtn.classList.add("active");
		courseBtn.classList.remove("active");
	});

	courseBtn.addEventListener("click", () => {
		courseGrid.classList.remove("hidden");
		serviceGrid.classList.add("hidden");
		courseBtn.classList.add("active");
		serviceBtn.classList.remove("active");
	});
});